    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    NWR outlines Refuge accomplishments from September through December of 1960. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including waterfowl, upland game birds, big game animals,
    marine mammals, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments. Resource management is outlined; topics
    include grazing. The public relations section of the report describes recreational
    uses and Refuge visitors. N-R forms and photographs are attached.",nt"license_title":
